import React from 'react';
import HomePage from './pages/homepage/homepage.component';
import { Switch, Route } from 'react-router-dom';

import './App.css';

const App = () => {
	return (
		<div>
			<Switch>
				<Route eHomePagexact path='/' component={HomePage} />
			</Switch>
		</div>
	);
};

export default App;
